import React, {useState, useEffect, useContext} from 'react';
import { useNavigate } from 'react-router-dom';
import '../../styles/Profile.css';
import ArrowBackIcon from '@mui/icons-material/ArrowBack';
import LogoutIcon from '@mui/icons-material/Logout';
import { globalContext } from '../../App';


const DefaultState = {
  name: "",
  access_token: "",
  blood_group: "",
  blood_pressure: "",
  date_of_birth: "",
  created: "",
  height: "",
  id: "",
  medical_history: "",
  photos: "",
  weight: "",
  email: "",
  medical_id: '123456789',
}


function PatientProfile() {
  const navigate = useNavigate();


  const {globalState, setGlobalState} = useContext(globalContext);

  useEffect(()=>{
    console.log("empty dep array");
    const appState = localStorage.getItem('globalState');
    if(appState){
      setGlobalState(JSON.parse(appState));
    }
  }, []);

  useEffect(()=>{
    // we need to do this but once 
      console.log("28 marks in CS725. FML")
  }, [globalState]);


  // Mocked patient data
  // const patientData = {
  //   name: 'John Doe',
  //   email: 'john.doe@example.com',
  //   medical_id: '123456789',
  //   photo: '', // Set this to a photo URL if available, or leave as an empty string for the placeholder
  // };

  const handleEditProfile = () => {
    navigate('/edit-profile');
  };

  const handlesPatientLogout = ()=>{
    let storedUserJWT = localStorage.getItem('patient_access_token');
    if(storedUserJWT){
      localStorage.removeItem('patient_access_token');
    }
    setGlobalState((state)=>{
      return (
        DefaultState
      )
    });

    navigate('/');
  }


  return (
    <div className="patient-profile-container">
      {/* <div className="dashboard-navbar">

        <h2 className="dashboard-title">Book an appointment</h2>
        <div className='dashboard-navbar-right'>
          <button className='dashboard-button' onClick={handlesPatientLogout}>
          <LogoutIcon/>
          </button>
        </div>
      </div> */}
      <div className="dashboard-navbar">
      <div className='dashboard-navbar-right'>
          <button className='dashboard-button' onClick={handlesBackButton}>
            <ArrowBackIcon />
          </button>
          </div>
        <h2 className="dashboard-title">Welcome, {globalState['name']}</h2>
        <div className='dashboard-navbar-right'>
          <button className='dashboard-button' onClick={handlesPatientLogout}>
          <LogoutIcon/>
          </button>
        </div>
      </div>
      <div className="patient-profile-content">
        <div className="patient-profile-image-container">
          {globalState.photo ? (
            <img src={globalState.photo} alt="Patient Profile" className="patient-profile-image" />
          ) : (
            <div className="patient-profile-no-image">No Photo</div>
          )}
        </div>
        <div className="patient-profile-info">
          <div className="patient-profile-row">
            <label>Name:</label>
            <p>{globalState.name}</p>
          </div>
          <div className="patient-profile-row">
            <label>Contact:</label>
            <p>{globalState.email}</p>
          </div>
          <div className="patient-profile-row">
            <label>Medical ID:</label>
            <p>{globalState.medical_id}</p>
          </div>

          <div className="patient-profile-row">
            <label>Body Weight:</label>
            <p>{globalState.weight}</p>
          </div>
          <div className="patient-profile-row">
            <label>Height:</label>
            <p>{globalState.height}</p>
          </div>
          <div className="patient-profile-row">
            <label>Blood Group:</label>
            <p>{globalState.blood_group}</p>
          </div>
          <div className="patient-profile-row">
            <label>Medical History:</label>
            <p>{globalState.medical_history}</p>
          </div>
            <button className="patient-edit-button" onClick={handleEditProfile}>
              Edit Profile
            </button>
        </div>  
      </div>
    </div>
  );
}

export default PatientProfile;
